import React, { useState } from "react";
import Modal from "./Modal";
import "./Navbar.css";

export default function Navbar() {
  const [isOpen, setIsOpen] = useState(false);

  const onClickButton = () => {
    setIsOpen(true);
  };
  return (
    <>
      <header className="header">
        <h1>My Pocket</h1>
        <a className="button" onClick={onClickButton}>
          로그인
        </a>
      </header>
      {isOpen && (
        <Modal
          open={isOpen}
          onClose={() => {
            setIsOpen(false);
          }}
        />
      )}
    </>
  );
}
